INSERT INTO `products` VALUES (1,'Ruby','RUBY – KAMPU –METAL : GOLD , LIQUID:-  COW MILK - SUNDAY : 15 MINTS\r\nMANTRAM : OM HREM SHREM KLEM NAMHA SURYAYA NAMAHA SWAHA ( 108 TIMES)RUBY/KAMPU  WEAR THIS STONE IN GOLD  TO YOUR RING FINGER . LADIES OR GENTS MUST WEAR THIS STONE TO RIGHT HAND RING FINGER ONLY.',4000.00,'ruby.png','2020-03-16 01:28:17','2020-04-05 06:56:52',NULL,'Stone'),(2,'DaImond','DAIMOND- VAJRAM – GOLD METAL – LIQUID: RICE CLEANING WATER – 15MINTS- FRIDAY. MANTRAM: OM SHREM AIM HREM SHREM BRUGUMANAVA SHUKRAYA SWAHA (108 TIMES).\r\nDAIMOND-  VAJRAM WEAR THIS STONE TO RIGHT HAND LITTLE FINGER OR MIDDLE FINGER. FOR LADIES LEFT HAND LITTLE FINGER OR MIDDLE FINGER.\r\n\r\n',15000.00,'diamond.png','2020-03-16 01:28:17','2020-04-05 07:16:26',NULL,'Stone'),(3,'YELLOW SAPPHIRE ','JUPITER : KANAKA PUSHYA RAGHUM – GOLD METAL : LIQUID: KOMMU SANAGALU BOILED WATER – 15MINTS – THURSDAY MANTRAM: OM AIM SHREM HREM KLEM BRUHASPATAYA SWAHA (108 TIMES)\r\n\r\nJUPITER : KANAKA PUSHYA RAGHUM BOTH LADIES AND GENTS MUST WEAR THIS STONE TO RIGHT HAND INDEX FINGER ',5500.00,'jupiter.png','2020-03-16 01:28:17','2020-04-05 07:16:57',NULL,'Stone'),(4,'Red Coral','RED CORAL : PAGADAM- METAL :SILVER ,GOLD , LIQUID : COW MILK – TUESDAY:15MINTS MANTRAM : OM LAM AIM HREM SHREM MAHIPUTRATA SAKLARISHTA NIVARANAYA KLEM KLEM SWAHA. ( 108 TIMES)\r\nRED CORAL : PAGADAM WEAR THIS STONE IN SILVER OR GOLD TO RIGHT HAND RING FINGER IF U HAVE KUJA DOSHAM YOU NEED TO WEAR JAPAN PAGADAM \r\nFOR LADIES LEFT HAND RING FINGER\r\n',2500.00,'red_coral.png','2020-03-16 01:28:17','2020-04-05 07:37:57',NULL,'Stone'),(5,'Indrani Roopu','IF SUPPOSE IF YOUR FACING PROBLEM WITH VENUS PLANET THEN U WEAR THIS INDRANI ROOPU KANKANUM TO YOUR RIGHT HAND.SO THAT VENUS PLANETARY PROBLEMS WILL BE VANISHED.WEAR THIS KANKANAM ON FRIDAY MORNING 6AM TO AM .',1000.00,'indrani_roopu.jpg','2020-03-16 01:28:17','2020-03-16 01:28:17',NULL,'Kanakanam'),(6,'Kaalabairava Roopu','IF SUPPOSE IF YOU ARE FACING PROBLEM WITH SATURN LIKE YELI NATI SHENI,STRESS ETC. WEAR THIS KANKANAM TO SOLVE YOUR PROBLEM UT WAER THIS KANKANAM ON SATURDAY AT 6AM TO 7 AM MORNING.',600.00,'kalabhaivara_roopu.jpg','2020-03-16 01:28:17','2020-04-05 08:42:07',NULL,'Kanakanam'),(7,'1 Mukhi','Ruling Planet Sun   - Goddess Lakshmi (Wealth).One Mukhi Rudraksha represents the ultimate reality, and Lord Shiva. Its ruling planet is the sun and it is worn or kept to lessen the bad effects of the sun. It increases concentration for work and meditation and will power of the wearer. It prevents diseases  of the head. It also gives happiness and prosperity. ',1000.00,'1_mukhi.jpg','2020-03-16 01:28:17','2020-03-16 01:28:17',NULL,'Rudraksha'),(8,'MOON STONE ','PEARL- MUTHYAM- METAL:SILVER, LIQUID:- MILK – MONDAY : 15MINTS\r\n\r\nMANTRAM : OM VAM AIM HREM SHREM JOOM YEE CHANDRA MAPAY SWAHA (108 TIMES)\r\nPEARL- MUTHYAM WEAR THIS STONE IN SILVER METAL TO RIGHT HAND LITTLE FINGER IF U ARE GENT , FOR LADIES LEFT HAND LITTLE FINGER \r\n',1200.00,'MOON_STONE.png','2020-04-05 07:03:54','2020-04-05 07:38:38',NULL,'Stone'),(9,'EMERALD GREEN ','MERCURY : PACHAA: METAL GOLD : LIQUID : PASUPU/TERMERIC  WATER WEDNESDAY: 15 MINTS .\r\nMANTRAM: OM  SHREM AIM HREM SHREM SOWMYAYA SOUHA KLEM AIM BUDHAYA SWAHA (108 TIMES)\r\nMERCURY : PACHAA WEAR THIS STONE IN GOLD TO YOUR LITTLE OR RING FINGER . LADIES MUST WEAR THIS STONE TO LEFT HAND LITTLE FINGER OR RING FINGER.',7500.00,'EMERALD_GREEN.png','2020-04-05 07:07:52','2020-04-05 07:51:56',NULL,'Stone'),(10,'BLUE SAPPHIRE','SATURN- SHENI – METAL :SILVER- LIQUID BLACK GRAPE JUICE -15MINTS ON SATURDAY\r\nMANTRAM : OM HREM AIM SHREM SHENISCHARAYA NIRMANSA SUSHKA DEHAYA SARVA SIDDI DEHI DEHI SWAHA. (108 TIMES)\r\nSATURN- SHENI WEAR THIS STONE TO RIGHT HAND MIDDLE FINGER, FOR LADIES LEFT HAND MIDDLE FINGER.',5000.00,'BLUE_SAPPHIRE.png','2020-04-05 07:12:17','2020-04-05 07:39:36',NULL,'Stone'),(11,'GOMEDAKAM ','DRAGONS HEAD - GOMADAKUM – METAL : SILVER – LIQUID : HONEY -15 MINTS ON SUNDAY.\r\n                       MANTRAM : OM BREM AIM HREM SHREM TAMO GRAHAYA SWAHA (108 TIMES)\r\nDRAGONS HEAD- GOMADAKUM WEAR THIS STONE TO RIGHT HAND MIDDLE FINGER FOR LADIES LEFT HAND MIDDLE FINGER.',2500.00,'GOMEDAKAM.png','2020-04-05 07:15:21','2020-04-05 07:15:21',NULL,'Stone'),(12,'CAT EYE','DRAGONS TAIL- CATEYE (VYDURYAM)- METAL :SILVER –LIQUID : ULAVALU BOILED WATER -15MINTS ON TUESDAY.\r\nMANTRAM : OM HREM KLEM AIM HREM SHREM KETAAVAY KANDA SIRASAY SWAHA(108 TIMES)\r\nDRAGONS TAIL- CATEYE (VYDURYAM)-WEAR THIS STONE TO RIGHT HAND LITTLE FINGER FOR LADIES LEFT HAND LITTLE FINGER.',3000.00,'CATEYE_.png','2020-04-05 07:42:08','2020-04-05 07:42:08',NULL,'Stone'),(13,'RAHU KETU RING ','THIS RING WILL CONTROL THE RAHU KETU DOSHAM , WE NEED TO WEAR THIS RING TO LEFT HAND RING FINGER .LADIES OR GENTS WHO ARE HAVING KALASARPA DOSHAM CAN WEAR THIS RING. ',5500.00,'RAHU_KETU_.png','2020-04-05 07:50:18','2020-04-05 07:50:18',NULL,'Stone'),(14,'GOMATHI CHAKRA RING','GOMATHI CHAKRA RING TO ANY FINGER LADIES OR GENTS  CAN WEAR .IT WILL PROTECT US FROM EVIL EFFECTS.',1000.00,'GOMATHI_CHAKRA.png','2020-04-05 07:55:28','2020-04-05 07:55:28',NULL,'Stone'),(15,'PASUPATHI KANKANAM','; IF YOU WEAR THIS KANKANAM ON THURSDAY 6 AM TO 7AM, MARRIAGE , JOB PROBLEMS WILL BE VANISHED',600.00,'PASUPATHI_KANKANAM.png','2020-04-05 07:59:53','2020-04-05 08:42:42',NULL,'Kanakanam'),(16,'MEDHA DHAKSHINA MURTHY ','MEDHA DHAKSHINA MURTHY DOLLAR: IF YOUR WEAR THIS TO YOUR NECK EDUCATIONAL PROBLEMS WILL BE VANISHED.',600.00,'M_MURTHY.png','2020-04-05 08:02:23','2020-04-05 08:43:06',NULL,'Kanakanam'),(17,'MAHA PASHUPATA KANKANAM','IF YOUR FACING PROBLEM WITH ILL HEALTH WEAR IT ON SATURDAY.',1000.00,'MPP.png','2020-04-05 08:04:48','2020-04-05 08:48:35',NULL,'Kanakanam'),(18,'SOWRA KANAKANAM ','THIS KANKANAM IS USED TO WEAR ONLY IF YOU HAVE  SUN PROBLEM OR HEALTH PROBLEM.ON SUNDAY AT MORNING 6AM TO 7 AM YOU NEED TO WEAR IT.',1000.00,'SOURA.png','2020-04-05 08:06:21','2020-04-05 08:44:17',NULL,'Kanakanam'),(19,'AMETHYST BRACELET','WEARING THIS BRACELET IT WILL INCREASE CONCENTRATION IN STUDIES. ',1200.00,'AMETHYST_.png','2020-04-05 08:11:13','2020-04-05 08:44:33',NULL,'Gems');
